import { StateContext} from '../../context/AppProvider'

function Orders() {

    const ordereitem = useContext(StateContext)

    let orderpackage = ordereitem.orderItem.map((item , index)=>{
      return(
        <div key={index}>
           <h2>Order No:- {index+1}</h2><br />
           <h2>[]</h2><br />
        </div>
      )
    })

  return (
    <section>
      <div className="container">
        <div className="order">
          <div className="order-item">
           <h1>Order Summary</h1>
           {orderpackage}

           <img src="https://images.unsplash.com/photo-1455619452474-d2be8b1e70cd?q=80&w=2070&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D" alt="" /><br />
           <h2>Name: muhammed</h2><br />
           <h2>Phone: 4445</h2><br />
           <h2>Address: mjhjdfnuhkmvkgmg</h2><br />
           <h2>pincode: 65956</h2><br />

           <h2>Tottal price</h2><br />
           <h2>Payment Methode</h2> <hr />
          </div>
        </div>
      </div>
    </section>
  )
}

export default Orders
